import React from "react";
import "../Styles/main.css";
import "../Styles/Home.css";

function Home() {
  return (
    <div>
      <h1>Photos</h1>
      <div className="photo-flex">
        <img src={wpsLogo}></img>
      </div>
    </div>
  );
}

export default Home;
